COPY breed_chars (breedchar_id, breed_id, char_id, description) FROM stdin;
1	18	5	Neck- Good reach of neck which is long, fine and muscular, slightly arched. The skin is fine and does not form a dewlap.Topline- Nearly straight, horizontal or rising toward the hips. Withers are quite prominent.Body- Length of body/height at withers - 9:10. Length of body is 90 percent height of hound. This ratio may be slightly higher in bitches. Fault-Body too long. Chest - Height of chest/height at withers - about 4:10. Height of chest is 40 percent of height at withers. Well developed in length, deep but without reaching elbow level. It is not very wide, but must have enough space for the heart, so the sternal region of the chest must not abruptly become narrow.
2	18	6	Forequarters are seen as a whole: long, fine, almost entirely vertical. Shoulders - Long, lean and muscular and only slightly slanting seen in profile. The scapulohumeral angle is very open (about 130 degrees). Dewclaws - may or may not be removed. Feet - Rounded shape, with fine and tightly closed toes. Pads may be pigmented.
3	18	4	Eyes- Almond shaped, quite large. Their color is in keeping with the coat color. Eye rims are pigmented.Ears- Set quite high. They are fine, always drooping and flat, quite wide at the base, close to the skull, never a rose ear. Their shape is that of a triangle with a slightly rounded tip. Their base rises when the hound is attentive.
4	18	9	Skin - Fine, tight over the whole body. Hair - Short, fine, down to none on the belly. Color - Color and markings are immaterial. Serious Fault - Harsh or semi-long coat. Coat not identical to the standard.
5	18	7	Hindquarters are seen as a whole: long and lean; legs perfectly vertical. Thighs - Long and prominent with lean muscles. The coxofemoral angle is very open (about 130 degrees). Stifle - The femorotibial angle is very open (about 140 degrees). Hock - Hock joint and hock are straight and lean, without dewclaws. Feet - round shaped, with fine and tightly closed toes. Pads may be pigmented.
6	18	1	The Azawakh is also known as the Tuareg Sloughi.
7	18	12	Azawakhs are generally a healthy breed.
8	18	8	he breed's coat needs only minimal upkeep with a hound glove or soft bristle brush.
9	18	3	The Azawakh is an African sighthound of Afro-Asiatic type, which appeared in Europe towards 1970 and, comes from the Nigerian middle basin, among others, from the Valley of the Azawakh. For hundreds of years, he has been the companion of the nomads of the southern Sahara. Particularly leggy and elegant, the Azawakh gives a general impression of great fineness. His bone structure and musculature are transparent beneath fine and lean skin. This sighthound presents itself as a rangy dog whose body fits into a rectangle with its longer sides in a vertical position. Faults - Heavy general appearance.
10	18	10	Good nutrition for Azawakhs is very important from puppyhood to their senior years.
11	18	11	The Azawakh possesses an uncanny combination of total loyalty and independence.
12	18	2	1997 - The Azawakh was first recorded in the Foundation Stock Service.
13	202	12	Russian Toys are generally a healthy breed.
14	202	1	The Russian Toy has been assigned the Toy Group designation.
15	202	8	The breed's medium-haired, coat requires weekly brushing with a brush or slicker to prevent mats.
16	202	10	Good nutrition for Russian Toys is very important from puppyhood to their senior years.
17	202	11	The Russian Toy, like all dogs, needs regular exercise to keep them healthy and fit both physically and mentally.
18	202	2	2008 - The Russian Toy was recorded in the Foundation Stock Service
19	11	5	Back:Fairly short. Slight sloping from withers to rump with gentle short slope at rump to base of tail. Loins slightly tucked.Body:Well-sprung ribs, deep in rear. All ribs close together. Forelegs set rather wide apart to permit chest development. Chest deep and broad.
20	11	4	Head:Medium length, deep through, broad skull, very pronounced cheek muscles, distinct stop; and ears are set high.Ears- Cropped or uncropped, the latter preferred. Uncropped ears should be short and held rose or half prick. Full drop to be penalized.Eyes- Dark and round, low down in skull and set far apart. No pink eyelids.Muzzle- Medium length, rounded on upper side to fall away abruptly below eyes. Jaws well defined. Underjaw to be strong and have biting power. Lips close and even, no looseness. Upper teeth to meet tightly outside lower teeth in front. Nose definitely black.Neck:Heavy, slightly arched, tapering from shoulders to back of skull. No looseness of skin.
21	11	9	Short, close, stiff to the touch, and glossy.
22	11	12	The American Staffordshire Terrier is generally considered a robust and healthy breed.
23	11	1	American Staffordshire Terriers are intelligent and excellent guardians.
24	11	8	This breed'92s short coat is low-maintenance but will require periodic brushing.
25	11	10	Good nutrition for American Staffordshire Terriers is very important from puppyhood to their senior years.
26	11	11	Somewhat Active; Versatile and athletic, AmStaffs like mental and physical challenges.
27	11	2	1936 - The American Staffordshire Terrier was officially recognized by the AKC
28	171	5	Theneckis powerful and blends smoothly into well laid back, clean shoulders, and should be of sufficient length to allow the dog to follow a trail. It has an abundance of hair; a slight dewlap is permissible. Thetoplineis level from the withers to the base of tail. The chest is deep reaching at least to the elbows on a mature hound. Forechest is evident, there is sufficient width to impart strength and endurance. There should be no indication of narrowness or weakness. The well sprung, oval rib cage extends well towards the rear of the body. The loin is short, broad and strong.
29	171	6	Shoulders are clean, powerful, and well sloped with moderate angulation at shoulders and elbows. Legs are strongly boned and straight, with strong, slightly sprung pasterns. Dewclaws on the forelegs may be removed. Feet - Both front and rear feet are large, broad, compact when standing, but capable of spreading. They have thick, deep pads, with arched toes; they are web-footed (membranes connecting the toes allow the foot to spread).
53	75	12	No breed is free from worry, even with careful breeding.
54	75	8	Clumbers do not require extensive grooming but should be brushed two to three times a week to prevent mats.
55	75	3	The Clumber Spaniel is a long, low, substantial dog. His heavy brow, deep chest, straight forelegs, powerful hindquarters, massive bone and good feet all give him the power and endurance to move through dense underbrush in pursuit of game. His white coat enables him to be seen by the hunter as he works within gun range. His stature is dignified, his expression pensive, but at the same time he shows great enthusiasm for work and play.
56	75	10	Good nutrition for Clumbers is very important from puppyhood to their senior years.
30	171	4	Theheadis large, fairly narrow, and well covered with hair. The head should measure 11 to 12 inches from tip of nose to occiput in a hound 26 inches at the withers, with the muzzle and skull approximately equal in length. This proportion should be maintained in larger and smaller hounds. Theexpressionis open and amiable. Theeyesare deeply set. The haw shows only slightly. The eyes are dark, but eye color and eye rim pigment will complement the color of the hound. Dogs with black pigmented noses and eye rims should have darker eyes, while those with liver or slate pigment may have hazel eyes. Theears, an essential feature of this breed, are long, pendulous, and folded (the leading edge folds or rolls to give a draped appearance). They are set low, at or below eye level, and hang close to the head, with the leather reaching at least to the tip of the nose. They are well covered with hair.
31	171	9	The coat is an essential feature of the Otterhound. Coat texture and quality are more important than the length. The outer coat is dense, rough, coarse and crisp, of broken appearance. Softer hair on the head and lower legs is natural. The outer coat is two to four inches long on the back and shorter on the extremities. A water-resistant undercoat of short wooly, slightly oily hair is essential, but in the summer months may be hard to find except on the thighs and shoulders. The ears are well covered with hair, and the tail is feathered (covered and fringed with hair). A naturally stripped coat lacking length and fringes is correct for an Otterhound that is being worked. A proper hunting coat will show a hard outer coat and wooly undercoat. The Otterhound is shown in a natural coat, with no sculpturing or shaping of the coat.
32	171	7	Thighs and second thighs are large, broad, and well muscled. Legs have moderately bent stifles with well-defined hocks. Hocks are well let down, turning neither in nor out. Legs on a standing hound are parallel when viewed from the rear. Angulation front and rear must be balanced and adequate to give forward reach and rear drive. Dewclaws, if any, on the hind legs are generally removed. Feet are as previously described.
33	171	1	The Otterhound is more rare than the Giant Panda.
34	171	12	Otterhounds are generally a healthy breed.
35	171	8	Grooming can be a wonderful bonding experience for you and your pet.
36	171	3	The Otterhound is a large, rough-coated hound with an imposing head showing great strength and dignity, and the strong body and long striding action fit for a long day's work. It has an extremely sensitive nose, and is inquisitive and perseverant in investigating scents. The Otterhound hunts its quarry on land and water and requires a combination of characteristics unique among hounds-most notably a rough, double coat; and substantial webbed feet. Otterhounds should not be penalized for being shown in working condition (lean, well muscled, with a naturally stripped coat). Any departure from the following points should be considered a fault; its seriousness should be regarded in exact proportion to its degree.
37	171	10	Good nutrition for Otterhounds is very important from puppyhood to their senior years.
38	171	11	Somewhat Active; These playful, athletic, all-weather hounds enjoy their exercise'97swimming a specialty.
39	171	2	1909 - The Otterhound was officially recognized by the AKC.
40	143	1	The Kromfohrlander has been assigned the Non-Sporting Group designation.
41	10	12	American Leopard Hounds are generally a healthy breed.
42	10	1	Other names for the breed including American Leopard, American Leopard Cur and Leopard Cur.
43	10	8	The breed's short-haired, smooth coat requires weekly brushing with a soft bristle brush or hound glove.
44	10	10	Good nutrition for American Leopard Hounds is very important from puppyhood to their senior years.
45	10	11	Needs regular exercise to keep them healthy and fit both physically and mentally.
46	10	2	2012 - The American Leopard Hound was recorded in the Foundation Stock Service.
47	75	5	The Clumber should have a longneckwith some slackness of throat or presence of dewlap not to be faulted. The neck is strong and muscular, fitting into a well laid back shoulder. The back is straight, firm, long and level. The brisket is deep and the ribs well sprung. The chest is deep and wide. The loin arches slightly. Thetailis well feathered and set on just below the line of back; it's trimming minimal, serving to tidy the feathering to allow for a natural appearance and outline. The tail is normally carried level with the topline or slightly elevated, never down between the rear legs. The tail may be docked or left natural, both being of equal value. If docked, the tail's length should be in keeping with the overall proportion of the adult dog. If natural, the tailbone should extend to the point of hock, but should not extend to the ground.
48	75	6	The Clumber shoulder is well laid back. The upper arm is of sufficient length to place the elbow under the highest point of the shoulder. The forelegs are short, straight and heavy in bone, with elbows held close to the body. Pasterns are strong and only slightly sloped. The front feet are large, compact and have thick pads that act as shock absorbers. Removal of dewclaws is optional.
49	75	4	Theheadis massive with a marked stop and heavy brow. The topskullis flat with a pronounced occiput. A slight furrow runs between the eyes and up through the center of the skull. Themuzzleis broad and deep to facilitate retrieving many species of game. The nose is large, square and colored shades of brown, which include beige, rose and cherry. The flews of the upper jaw are strongly developed and overlap the lower jaw to give a square look when viewed from the side. A scissorsbiteis preferred. Theeyesare dark amber in color, large, soft in expression, and deep set in either a diamond shaped rim or a rim with a V on the bottom and a curve on the top. Some haw may show but excessive haw is undesirable. Prominent or round shaped eyes are to be penalized. Excessive tearing or evidence of entropion or ectropion is to be penalized.Earsare broad on top with thick ear leather. The ears are triangular in shape with a rounded lower edge, set low and attached to the skull at approximately eye level.
50	75	9	The body coat is dense, straight and flat. It is of good weather resistant texture, which is soft to the touch, not harsh. Ears are slightly feathered with straight hair. Feathering on the legs and belly is moderate. The Clumber has a good neck frill and on no condition should his throat be shaved. Evidence of shaving is to be penalized. The hair on the feet should be trimmed neatly to show their natural outline and for utility in the field. The rear legs may be trimmed up to the point of the hock. Tail feathering may be tidied. Trimming of whiskers is optional.
51	75	7	The thighs are heavily muscled and, when viewed from behind, the rear is round and broad. The stifle shows good functional angulation, and hock to heel is short and perpendicular to the ground. Lack of angulation is objectionable. The rear feet are not as large or as round as on the front feet but compact, with thick pads and are of substantial size.
52	75	1	The Clumber Spaniel is believed to have originated in France.
57	75	11	Smart and eager-to-please Clumbers respond well to training.
58	75	2	1884 - The Clumber Spaniel was officially recognized by the AKC
